        The Revolution is an open-world FPS developed by Dambuster Studios. It is
        the second game in the series.</p>\n<h3>Plot</h3>\n<p>In 1972, a technological
        marvel emerged in North Korea. The APEX corporation was found. Sometime later,
        the North Korean technologies become more widespread than the US. In 2004
        the United States began to buy its weaponry from Korea. By 2016 the United
        States economy is at an all-time low, the US invade the Middle East. In 2025,
        the US debt to North Korea grows too immense to be paid out, and the economy
        crumbles. While being helpful at first, North Korea&#39;s military set foot
        on the American soil. You become a part of the resistance based in Philadelphia
        in 2029 trying to set the city free from Korean People&#39;s Army.</p>\n<h3>Gameplay</h3>\n<p>The
